import { useEffect } from "react";
import { useCBOContext } from "../hooks/useCBOcontext";

// Components
import CBODetails from "../components/CBODetails";
import CBOform from "../components/CBOform";

const Home = () => {
  const { cbos, dispatch } = useCBOContext();

  useEffect(() => {
    const fetchCBOs = async () => {
      const response = await fetch("/api/cbos");
      const json = await response.json();

      if (response.ok) {
        dispatch({ type: "SET_CBOS", payload: json });
      }
    };

    fetchCBOs();
  }, [dispatch]); // Runs once when component mounts

  return (
    <div className="home">
      <div className="cbos">
        {cbos &&
          cbos.map((cbo) => (
            <CBODetails key={cbo._id} cbo={cbo} />
          ))}
      </div>
      <CBOform />
    </div>
  );
};

export default Home;
